(function() {
  jQuery(function() {
    var sort;
    return App.sort = sort = function() {
      /*cells = $('.table').find('tr')[0].cells.length 
      desired_width = 940 / cells + 'px'
      $('.table td').css('width', desired_width)*/

      /*
      $('.table').find('tr')[0].cells[0]
      $(p).css('width')*/

      var updateRowIndex;
      updateRowIndex = function() {
        var $fila, fila, filas, new_index, _i, _len, _results;
        filas = $('.item');
        _results = [];
        for (_i = 0, _len = filas.length; _i < _len; _i++) {
          fila = filas[_i];
          $fila = $(fila);
          new_index = $fila.index() + 1;
          _results.push($(fila).find('td.orden').first().text(new_index));
        }
        return _results;
      };
      return $('#sortable').sortable({
        axis: 'y',
        items: '.item',
        handle: ".handle",
        stop: function(e, ui) {
          return ui.item.children('td').effect('highlight', {}, 1000);
        },
        update: function(e, ui) {
          var item_id, position;
          item_id = ui.item.data('item-id');
          position = ui.item.index();
          $.ajax({
            type: 'POST',
            url: $(this).data('update-url'),
            dataType: 'json',
            data: {
              id: item_id,
              user_practica: {
                row_order_position: position
              }
            }
          });
          return updateRowIndex();
        }
      });
    };
  });

}).call(this);
